import { SALAY_TEMPLATE } from '@/constants/brand/finance/salary-enum'
export default {
  serviceInject() {
    return {
      service: EditTemplateService
    }
  },
  rxState() {
    return {}
  },
  created() {
    this.service.getInfo(this.id).subscribe(res => {
      this.infodata = res.info
    })
  },
  data() {
    return {
      SALAY_TEMPLATE,
      show: false,
      infodata: {
        template_name: '',
        performance_type: {
          name: ''
        },
        performance_mode: {
          name: ''
        }
      }
    }
  },
  props: {
    id: Number
  },
  methods: {
    handleSubmit() {
      this.show = false
    }
  }
}
